import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";
  
const Search = () => {
  const [pesel, setPesel] = useState("");
  const [start_date, setStartDate] = useState("");
  const [end_date, setEndDate] = useState("");
  const [product_name, setProductName] = useState("");


  const getPrescriptionSearchData = () => {
    Axios.post("http://localhost:8080/api/test3", {
    pesel: pesel,
    start_date: start_date,
    end_date: end_date,
    product_name: product_name,
    }).then(() => {
      alert("succesful insert");
    });
  };
  return (
    <div className="App">
    <Header>Wyszukiwarka Recept</Header>
    <div className="inputsWrapper">
      <div>
        <label>Pesel:</label>
        <input
          type="text"
          name="pesel"
          onChange={(e) => {
            setPesel(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Data od:</label>
        <input
          type="text"
          name="data_od"
          onChange={(e) => {
            setStartDate(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Data do:</label>
        <input
          type="text"
          name="data_do"
          onChange={(e) => {
            setEndDate(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Nazwa Leku:</label>
        <input
          type="text"
          name="product_name"
          onChange={(e) => {
            setProductName(e.target.value);
          }}
        />
      </div>
    </div>

    <button onClick={getPrescriptionSearchData}>getPrescriptionSearchData</button>

  </div>
  );
};
  
export default Search;
